import React from 'react';
import ReactDOM from 'react-dom';
import {Container} from '@material-ui/core';
import TitleBar from './components/TitleBar'
import Summary from './components/Summary'

import './App.css';

function App() {
  const getPlaidAccount = () => {
    const account = window.localStorage.getItem("plaid_account");
    return account ? true : false;
  }

  const [addedAcc, setAddedAcc] = React.useState(getPlaidAccount);

  return (
    <Container maxWidth="sm">
        <TitleBar addedAccountChecker={()=> setAddedAcc(getPlaidAccount())} />
        <Summary addedAccount={addedAcc} />
    </Container>
  );
}

export default App;
